import React from 'react';
import Logo from '../assets/images/logo.png';
import './HomeStyles.css';

function Home() {
  return (
    <div className="container">
      <header>
        <img src={Logo} alt="logo"></img>
      </header>
    </div>
  );
}

export default Home;
